  false,\n\t\"url\": null,\n\t\"notes\": \"MODIS/Aqua chlorophyll frontal products:
  the NOAA Okeanos operational production system produces near real-time chlorophyll
  frontal products (magnitude and direction), with data of MODIS/Aqua L2 chlorophyll
  products that are generated in the Okeanos system using the NASA L2gen ocean color
  algorithm. The chlorophyll frontal products are calculated using the BOA-SNRA which
  is a concatenation of two acronyms, BOA and SNRA. The BOA stands for the Belkin-O.Reilly
  Algorithm for front detection (Belkin and O.Reilly, 2009) and the SNRA stands for
  the Stripe Noise Reduction Algorithm (Belkin et al, 2013). The BOA-SNRA code is
  included in the CoastWatch ocean color products processing software that was written
  by the NOAA CoastWatch team. Maps of oceanic chlorophyll fronts can be directly
  used in marine fisheries, marine conservation, environment protection, and other
  applications and operations. Real-time chlorophyll frontal products can be accessible
  via the following URL address: ftp://cw-okeanos.noaa.gov/pub/data1/products_by_type/aqua/frontal/.
  The historical products are archived in the NOAA Comprehensive Large Array-data
  Stewardship System (CLASS).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
